import React, { Component } from 'react';
import LessonBody from './LessonComponent/LessonBody';
import Frame from 'react-frame-component';

class Body extends Component {
  render() {
    return (
      <div>
        <Frame class="lesson">
          <link href="style.css" rel="stylesheet" />
          <LessonBody />
        </Frame>
        <Frame class="editor">
          <LessonBody />
        </Frame>
      </div>
    )
  }
}
export default Body;
